import React from 'react';
import Particles from 'react-particles-js';
import {Navigation, Logo, ImageLinkForm, Rank} from './Imports';
import './App.css';


const particlesOptions = {
particles: {
	number: {
		value:100,
		density: {
			enable:true,
			value_area: 800
		}
	}
}
}


function App() {
  return (
    <div className="App">
    	<Particles className='particles' params={particlesOptions}/>
    	<Navigation />
		<Logo />
		<Rank />
    	<ImageLinkForm />
{/*   
    	<FaceRecognition /> */}
    </div>
  );
}

export default App;
